import React, { Component } from 'react';
import RandomJoke from 'RandomJoke';
import './App.css';

export class App extends Component {

  constructor() {
    this.state = {
      iconUrl: '',
      id: '',
      url: '',
      value: ''
    };
  }

  onRetrivesJokes() {
    fetch('')
      .then(resp => resp.json())
      .then(jokes => console.log(jokes));
  }

  render() {
    return (
      <div className="App">
        <RandomJoke></RandomJoke>
      </div>
    );
  }

  componentDidMount() {
    this.onRetrivesJokes();
  }
}

export default App;
